@Nùng
-dân tộc Nùng
-With about 650,000 inhabitants, Nùng ethnic group occupies 1.05% of the Vietnamese population. Divided into many branches (Nùng Phan Sình, Nùng Cháo, Nùng Inh..), they live in Cao Bằng, Lạng Sơn, Tuyên Quang, Lào Cai, Yên Bái, Hà Giang. This ethnic group migrated late to Vietnam and had relations close to the Tày people. Their popular literature and arts is abundant in poems and tales..... They are courageous, battle-tested, good at farming and able to trade. After 1954, many of them migrated to Eastern Cochinchina and Central Highlands

